import React, { useEffect, useState, useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../context/AuthContext';
import api from '../utils/api';

const Dashboard = () => {
  const { currentUser } = useContext(AuthContext);
  const [overview, setOverview] = useState({});
  const [gigs, setGigs] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [orders, setOrders] = useState([]);
  const [activeRole, setActiveRole] = useState('client');

  useEffect(() => {
    if (currentUser.roles.includes('freelancer')) setActiveRole('freelancer');
    fetchDashboardData();
  }, [currentUser, activeRole]);

  const fetchDashboardData = async () => {
    try {
      const ordersResponse = await api.get(`/orders?role=${activeRole}`);
      setOrders(ordersResponse.data);

      if (activeRole === 'freelancer') {
        const gigsResponse = await api.get('/gigs/my-gigs');
        setGigs(gigsResponse.data);
      } else {
        const jobsResponse = await api.get('/jobs/my-jobs');
        setJobs(jobsResponse.data);
      }

      const overviewResponse = await api.get('/users/dashboard-overview');
      setOverview(overviewResponse.data);
    } catch (error) {
      console.error('Error loading dashboard data:', error);
    }
  };

  const switchRole = async (role) => {
    try {
      await api.patch('/users/switch-role', { role });
      setActiveRole(role);
      fetchDashboardData();
    } catch (error) {
      alert('Failed to switch role');
    }
  };

  return (
    <div>
      <h1>Welcome, {currentUser.username}!</h1>
      <div>
        <p>Total Gigs: {overview.totalGigs}</p>
        <p>Total Jobs: {overview.totalJobs}</p>
        <p>Total Orders: {overview.totalOrders}</p>
      </div>

      <div>
        <button onClick={() => switchRole('client')}>Switch to Client</button>
        <button onClick={() => switchRole('freelancer')}>Switch to Freelancer</button>
      </div>

      {activeRole === 'freelancer' && (
        <div>
          <h2>My Gigs</h2>
          <Link to="/create-gig">+ Create Gig</Link>
          {gigs.map(gig => (
            <div key={gig._id}>
              <Link to={`/gigs/${gig._id}`}>{gig.title}</Link>
              <button onClick={() => api.delete(`/gigs/${gig._id}`)}>Delete</button>
            </div>
          ))}
        </div>
      )}

      {activeRole === 'client' && (
        <div>
          <h2>My Jobs</h2>
          <Link to="/create-job">+ Post Job</Link>
          {jobs.map(job => (
            <div key={job._id}>
              <Link to={`/jobs/${job._id}`}>{job.title}</Link>
              <button onClick={() => api.delete(`/jobs/${job._id}`)}>Delete</button>
            </div>
          ))}
        </div>
      )}

      <div>
        <h2>My Orders</h2>
        {orders.map(order => (
          <div key={order._id}>
            <Link to={`/orders/${order._id}`}>{order.title}</Link>
            <p>Status: {order.status}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
